"""
 Given a string S and a string T, count the number of distinct subsequences of S which equals T.

A subsequence of a string is a new string which is formed from the original string by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters. (ie, "ACE" is a subsequence of "ABCDE" while "AEC" is not).

Here is an example:
S = "rabbbit", T = "rabbit"

Return 3.
"""
import numpy as np
class Solution(object):
    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        self.s = s
        self.t = t
        self.dict = {}
        self.m = len(s)
        self.n = len(t)
        def dfs(i, j):
            if j >= self.n:
                return 1
            if i >= self.m:
                return 0
            if (i, j) in self.dict:
                return self.dict[(i, j)]
            if self.s[i] == self.t[j]:
                a = dfs(i + 1, j) + dfs(i + 1, j + 1)
            else:
                a = dfs(i + 1, j)
            self.dict[(i, j)] = a
            return a
        return dfs(0, 0)


    def numDistinct_1(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        252ms
        """
        m = len(s)
        n = len(t)
        if m <= 0:
            return 0 if n > 0 else 1
        dp = [[0] * n for _ in range(m)]
        if s[0] == t[0]:
            dp[0][0] = 1
        for i in range(1, m):
            if s[i] == t[0]:
                dp[i][0] = dp[i - 1][0] + 1
            else:
                dp[i][0] = dp[i - 1][0]
        for j in range(1, n):
            for i in range(j, m):
                if s[i] == t[j]:
                    dp[i][j] += dp[i - 1][j - 1]
                dp[i][j] += dp[i - 1][j]
        print(np.array(dp))
        return dp[-1][-1]

    def numDistinct_2(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        176ms
        """
        m = len(s)
        n = len(t)

        dp = [[0] * (n + 1) for i in range(m + 1)]

        for i in range(m + 1):
            dp[i][0] = 1

        for i in range(1, m + 1):
            for j in range(1, n + 1):
                if s[i - 1] == t[j - 1]:
                    dp[i][j] = dp[i - 1][j - 1] + dp[i - 1][j]
                else:
                    dp[i][j] = dp[i - 1][j]

        return dp[m][n]

    def numDistinct_3(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        52ms
        """
        if not t:
            return 1

        from collections import defaultdict
        positions = defaultdict(lambda: [])
        for i, c in enumerate(t):
            positions[c].append(i)

        counts = [0] * len(t)
        for c in s:
            if c in positions:
                for p in reversed(positions[c]):
                    if p == 0:
                        counts[p] += 1
                    else:
                        if counts[p - 1] > 0:
                            counts[p] += counts[p - 1]
        return counts[-1]



S = "rabbbit"
T = "rabbit"
print(Solution().numDistinct_1(S, T))

